var villagers = []
  var tileSetMaxValues = [2, 4, 11, 8, 8, 8, 2]
  //village BOI class for future reference
  class VillageBoi {
      constructor() {
          this.id;
          this.clothes = [];
      }
  }
  //my pixel villager is 16x24px (they are animated so real size for one grid for layer is 64x96)
  var createRandom = () => {
    //tileSetMaxValues = document.getElementById("tileSetSize").value;
    //first clean the div from old bOI
    document.getElementById("villagersDiv").innerHTML = "";
    //add villager to array (it does not have a practical aplication yet, but will be usefull inn the future)
      villagers.push(new VillageBoi())
      villagers[villagers.length-1].id = villagers.length;
      //create new canvas that we will draw our villger on
      var villageCanvas = document.createElement("canvas")
      villageCanvas.width = document.getElementById("nftSizeY").value;
      villageCanvas.height = document.getElementById("nftSizeX").value;
      var ctx = villageCanvas.getContext("2d")
      //scroll through every layer and print random clothes asset from it
      for (var n = 0; n < 7; n++) {
          var yPos = n * document.getElementById("animNftSizeX").value;
          var randXPos = (Math.floor(Math.random() * tileSetMaxValues[n])) * document.getElementById("animNftSizeY").value
          if (n > 1 && Math.random() < 0.3) {
              //not all bois should have clothes/hats/etc
              villagers[villagers.length-1].clothes.push("none")
          } else {
              villagers[villagers.length-1].clothes.push(randXPos)
             ctx.drawImage(tileSetImage, randXPos, yPos, document.getElementById("nftSizeY").value,document.getElementById("nftSizeX").value, 0, 0, document.getElementById("nftSizeY").value, document.getElementById("nftSizeX").value)
          }
      }
      //now we have an array with villagers their dress and id
      document.getElementById("villagersDiv").append(villageCanvas)
  }

//convert image from png to base64 at https://www.base64-image.de/
var myConvertedImage = "data:image/png;base64,"

var tileSetImage = document.createElement("img")
//set source
window.onload = () => {
tileSetImage.src = myConvertedImage;
  createRandom();
}

